module.exports = (sequelize, DataTypes) => {
  const BlackListedToken = sequelize.define('BlackListedToken', {
    uuid: {
      type: DataTypes.UUID,
      defaultValue: DataTypes.UUIDV4,
      primaryKey: true
    },
    token: DataTypes.TEXT,
  }, {});
  BlackListedToken.associate = function(models) {
